package main.java.reservoirComputing;

public class DeterminantErrror extends Exception {

	public DeterminantErrror() {
		// TODO Auto-generated constructor stub
	}

	public DeterminantErrror(String message) {
		super(message);
	}

	public DeterminantErrror(Throwable cause) {
		super(cause);
	}

	public DeterminantErrror(String message, Throwable cause) {
		super(message, cause);
	}

	public DeterminantErrror(String message, Throwable cause,
			boolean enableSuppression, boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

}
